import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";


render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<App />}>
        <Route index element={<Home />} />

      </Route>
    </Routes>
  </BrowserRouter>,
  document.getElementById("root")
);
export default App;
